import core from './core' ;

export default function compile ( {

	add , sub , mul , div ,
	div2 , div2n ,
	neg ,
	sqrt , pow2 ,
	PI , cos , sin , atan2 ,
	parse , stringify ,
	$0 , $1 , $_1 ,
	eq0 , eq1 , eq_1 , gt0

} , symbol ) {

	const _mul = core.mul( mul , add , sub ) ;

	return {

		"$0" : core.$0( $0 ) ,
		"$1" : core.$1( $0 , $1 ) ,
		"root2n" : core.root2n( cos , sin , PI , div2n ) ,
		"iroot2n" : core.iroot2n( cos , sin , PI , div2n , neg ) ,
		"add" : core.add( add ) ,
		"sub" : core.sub( sub ) ,
		"mul" : _mul ,
		"imul" : _mul ,
		"div" : core.div( div , pow2 , mul , add , sub ) ,
		"div2" : core.div2( div2 ) ,
		"abs" : core.abs( sqrt , pow2 , add ) ,
		"arg" : core.arg( atan2 ) ,
		"con" : core.con( neg ) ,
		"parse" : core.parse( parse , $0 , $1 , $_1 , symbol ) ,
		"stringify" : core.stringify ( stringify , eq0 , eq1 , eq_1 , gt0 , symbol )

	} ;

}

/**
 * Computes the absolute value (or modulus or magnitude) of the complex number a + bi.
 */

export default ( sqrt , pow2 , add ) => ( a , b )  => sqrt( add( pow2( a ) , pow2( b ) ) ) ;

/**
 * Addition algorithm.
 *
 * Returns the result of (a + bi) + (c + di).
 */

export default base => ( a , b , c , d )  => [ base( a , c ) , base( b , d ) ] ;

/**
 * Computes the argument of the complex number a + bi.
 */

export default atan2 => ( a , b )  => atan2( b , a ) ;

/**
 * Conjugate for cartesian representation
 */

export default neg => ( a , b )  => [ a , neg( b ) ] ;

/**
 * Division algorithm
 */

export default ( base , pow2 , mul , add , sub )  => function ( a , b , c , d ) {

	const tmp = add( pow2( c ) , pow2( d ) ) ;

	const real = base( add( mul( a , c ) , mul( b , d ) ) , tmp ) ;
	const img  = base( sub( mul( b , c ) , mul( a , d ) ) , tmp ) ;

	return [ real , img ] ;

}

