/**
 * Multiplication algorithm
 */

export default ( base , add , sub ) =>  ( a , b , c , d )  => [ sub( base( a , c ) , base( b , d ) ) ,  add( base( a , d ) , base( b , c ) ) ] ;

/**
 * Parse
 *
 * /!\ DOES NOT CURRENTLY KNOW WHAT
 *     WOULD BE THE BEST IMPLEMENTATION
 */

export default function parse (base, $0, $1, $_1, symbol) {

	return function (s, i, j) {

		let aj , bi , dflt ;

		if (i === j) {
			return [$0(), $0()];
		}

		let ai = i;

		let c = s[i];

		for (;;) {

			if (c === symbol) {
				if (ai === i) {
					return [$0(), $1()];
				}
				else if (ai === i - 1) {
					if (s[ai] === '-') {
						return [$0(), $_1()];
					}
					else if (s[ai] === '+') {
						return [$0(), $1()];
					}
					else {
						return [$0(), base(s.slice( ai , i))];
					}
				}
				else {
					return [$0(), base(s.slice( ai , i))];
				}
			}

			++i;

			if (i >= j) {
				return [base(s.slice( ai , j)), $0()];
			}

			c = s[i];

			if ( c === '+' ) {
				dflt = $1;
				aj = i;
				bi = i;
				break;
			}
			else if ( c === '-' ) {
				dflt = $_1;
				aj = i;
				bi = i;
				break;
			}

		}


		for (;;) {

			++i;
			c = s[i];

			if (c === symbol) {
				if (bi === i - 1) {
					return [base(s.slice( ai , aj)), dflt()];
				}
				else {
					return [base(s.slice( ai , aj)), base(s.slice( bi , i))];
				}
			}

		}

	};
}

/**
 * Stringify
 */

export default function stringify ( base , eq0 , eq1 , eq_1 , gt0 , symbol ) {

	return function ( a , b ) {

		const azero = eq0(a);

		const bzero = eq0(b);

		if (azero && bzero) {
			return "0";
		}

		let out = "";

		if (!azero) {

			out += base(a);

			if (gt0(b)) {
				out += "+";
			}

		}

		if (!bzero) {

			if (eq_1(b)) {
				out += "-";
			}
			else if (!eq1(b)) {
				out += base(b);
			}

			out += symbol;
		}

		return out;

	};
}

/**
 * Subtraction algorithm
 *
 * Returns the result of (a + bi) - (c + di).
 */

export default base => ( a , b , c , d )  => [ base( a , c ) , base( b , d ) ] ;

